import React, { Component } from "react";

function getDate() {
      let date = new Date();

      let dayName = Intl.DateTimeFormat("en-US", {
            weekday: "short",
      }).format(date);

      let monthName = Intl.DateTimeFormat("en-US", {month: "long"}).format(date);

      let dateString = `${monthName} ${date.getFullYear()}`;
      return dateString;
}

class Calendar extends Component {
      render() {
            return (
                  <>
                        <p> {getDate()}</p>
                        <div className="container" id="monthyear">
                        <table id="calendar">
                        <thead>
                        <tr>
                        <th>weekdays</th>
                        </tr>
                        </thead>
                        <tbody id="calendarBody">
                        </tbody>
                        </table>
                        </div>
                  </>
            );
      }
}

export default Calendar;
